import React from "react";

import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/css";

export default function TestimonialCarousel() {
  return (
    <>
      <Swiper
        slidesPerView={3}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[]}
        className="mySwiper"
      >
        <SwiperSlide>
          <Testimonial></Testimonial>
        </SwiperSlide>
      </Swiper>
    </>
  );
}
